'use client';
import { useRouter } from 'next/navigation';
import React, { useEffect, useState } from 'react';
import Image from 'next/image';
import { getSiteDetails } from '@/services/getRequests';

function Logo() {
  const { push } = useRouter();
  const [logoUrl, setLogoUrl] = useState('');

  useEffect(() => {
    async function fetchLogo() {
      try {
        const siteDetails = await getSiteDetails();
        setLogoUrl(siteDetails?.data?.tenantDetail?.logo || '/path/to/your/logo.png');
      } catch (error) {
        console.error('Error fetching site details:', error);
      }
    }

    fetchLogo();
  }, []);

  return (
    <div
      className="text-white font-bold shiny-hover cursor-pointer"
      onClick={() => push('/')}
    >
      {logoUrl ? (
        <Image
          style={{ filter: 'drop-shadow(0px 0px 3px black)' }}
          src={logoUrl}
          alt="company-logo"
          height={10}
          width={150}
          className="h-[60px] sm:h-[70px] md:h-[75px] w-auto object-contain transition-transform duration-500 hover:rotate-12"
        />
      ) : (
        <p></p>
      )}
    </div>
  );
}

export default Logo;
